window.bookSummaryJSON = "<p>War has come to Faery, and there’s no escaping the final battle. We thought we were ready for anything. We were wrong. I couldn’t change who I was, so Destiny stepped in, forcing me to become what Faery needed to face down our enemies.</p> <p>Can I forgive what happened and move past the lies and betrayals? Or will I destroy a world to bring the man I love to his knees, requiring us to become the monsters the world wants us to be?</p> <p>If you’re following the series for the Fae Chronicles, Elite Guards, and Monsters, listening order is as follows. </p> <p><i>Fighting Destiny </i></p> <p><i>Taunting Destiny </i></p> <p><i>Escaping Destiny </i></p> <p><i>Seducing Destiny </i></p> <p><i>A Demon’s Dark Embrace </i></p> <p><i>Playing with Monsters </i></p> <p><i>Unraveling Destiny </i></p> <p><i>Sleeping with Monsters </i></p> <p><i>Claiming the Dragon </i></p> <p><i>King Oh, Holy Knight </i></p> <p><i>Becoming his Monster </i></p> <p><i>A Demon’s Plaything </i></p> <p><i>The Winter Court </i></p> <p><i>If She’s Wicked </i></p> <p><i>Embracing Destiny </i></p> <p><i>Crowning Destiny </i></p> <p>Perfect for anyone who loves an epic battle of love and loss, and war.</p>"; 
